import { Recipe } from "./recipe.model";
import { Output, EventEmitter } from "@angular/core";

export class RecipeService{
    @Output() recipeAdded: EventEmitter<Recipe[]>;
    constructor(){
        this.recipeAdded = new EventEmitter<Recipe[]>();
    }

    private recipes: Recipe[] = [
        new Recipe("Test Recipe", "This is just a test recipe", "data:image/jpeg;base64,"),
        
        new Recipe("Another Test Recipe", "This is the duplicate of the first recipe", "data:image/jpeg;base64,")
      ];

    getRecipes(){
        return this.recipes.slice();
    }

    addRecipe(recipe: Recipe){
        this.recipes.push(recipe);
        this.recipeAdded.emit(this.recipes);
    }
}